import React from 'react';
import '../css/DistanceOrder.css';

const sampleHospitals = [
  { id: 1, name: 'Hospital A', distance: '1km', Acongestion: '10', Bcongestion: '10' },
  // ... 나머지 병원 데이터
];

const DistanceOrder = ({ userLocation }) => {
  return (
    <div className="distance-container">
      <h2>{userLocation}</h2>

      <ul className="hospital-list">
        {sampleHospitals.map((hospital) => (
          <li key={hospital.id}>
            <span className="hospital-name">{hospital.name}</span>
            <span className="hospital-distance">{hospital.distance}</span>
            <div>
              <span>성인 혼잡도: {hospital.Acongestion}</span>
              <span>소아 혼잡도: {hospital.Bcongestion}</span>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DistanceOrder;
